// src/index.js

import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // Include your CSS styles here
import App from './App';
import mermaid from 'mermaid';

// Initialize Mermaid
mermaid.initialize({
    startOnLoad: true,
    theme: 'default',
    securityLevel: 'loose',
    themeVariables: {
        primaryColor: '#f79321',
        primaryTextColor: '#fff',
        primaryBorderColor: '#f79321',
        lineColor: '#f79321',
        secondaryColor: '#fff',
        tertiaryColor: '#fff',
    },
});

ReactDOM.render(<App />, document.getElementById('root'));
